#include <iostream>
#include <string>
#include <vector>
#include <set>
#include <map>
#include <algorithm>
#include <math.h>
#include <sstream>
 
using namespace std;
 
int gcd(int a, int b)
{
  if (b > a) return gcd(b, a);
  else if (a%b==0) return b;
  else return gcd(b, a%b);
}
 
int lcm(int a, int b)
{
  return a * b / gcd(a, b);
}
 
int sum(vector<int> a)
{
  int total=0;
  for(int i=0; i<a.size(); i++)
    total += a[i];
  return total;
}
 
class NumberGuesser
{public:
 
int guess(string s)
{  int temp = 0;
  for(int i=0; i<s.size(); i++)
    temp += s[i] -'0';
  temp = temp % 9;
  return 9-temp;
}
};

